actionConfiguration.body:
(serialNumber) =>{
		if (serialNumber.length < 1){
			return [false,"Cannot submit an empty serial number"]
		}
		if (!appsmith.store.serialList){
			return [true,""]
		}
		if (appsmith.store.serialList.includes(serialNumber)){
			return [false, "Serial Number already exists"]
		}

		return [true,""]
	}

